    <title>API 文档</title>

  <style type="text/css">
    html,
    body {
        overflow: hidden;
        position: absolute;
        height: 100%;
        width: 100%;
        left: 0;
        top: 0;
    }

    body {
        display: -ms-flexbox;
        display: -webkit-box;
        display: flex;
        -ms-flex-pack: center;
        -webkit-box-pack: center;
        justify-content: center;
        box-shadow: inset 0 0 5rem rgba(0, 0, 0, .5);
        margin:0;
        background: #fff;
    }

    .container {
        -ms-transform: translate(-50%, -50%);
        -webkit-transform: translate(-50%, -50%);
        transform: translate(-50%, -50%);
        min-width: 50%;
        padding: 30px;
        text-align: center;
        position: absolute;
        left: 50%;
        top: 50%;
        border-top: none;
    }

    .container .logo {
      margin-bottom: 80px;
    }

    .container .logo img {
      width: 150px;
    }

    .container h1,
    .container h2 {
        letter-spacing: 0.05em;
    }
    .container h1 {
        font-size: 80px;
        text-transform: uppercase;
        color: #F80378;
    }
    .container h2 {
        font-weight: italic;
        text-transform: uppercase;
        font-size: 25px;
        overflow: hidden;
        margin: -45px -33px 0 -33px;
        position: absolute;
        width: calc( 100% + 6px);
        color: #000;
    }
    .container h2 .love {
        color: #F80378;
    }
    .container h2 .love a {
        color: #F80378;
    }
  </style>
  </head>
